// plugin based on websocket. by leetom
var WSDevice = function(id, wsAddr){
    //this.name = name; // scratch_extensionPicoBoard
    this.id = id;   //  COM1
    this.wsAddr = wsAddr;

    this.socket = new WebSocket(this.wsAddr);
    this.socket.binaryType = "arraybuffer";

    var dev = this;

    this.close = function(){
        //
        if(this.socket){
            this.socket.close();
        }
        delete this;
    };

    this.send = function(data){
       //
        if(this.socket.readyState == WebSocket.OPEN){
            this.socket.send(data);
        }else{
            this.disconnect_handler();
        }
    }

    this.set_error_handler = function(callback){
        // 
    }

    this.receive_handler = null;
    this.disconnect_handler = null;


    this.set_receive_handler = function(callback){
        // 
        dev.receive_handler = callback;
    }

    this.deviceonmessage = function(e){
        dev.receive_handler(e.data);
    }

    this.socket.onmessage = this.deviceonmessage;

    this.socket.onclose = this.close;

    this.set_disconnect_handler = function(callback){
       dev.disconnect_handler = callback;
    }

}
var DevicePlugin  = function(addr){
    this.wsAddr = "wss://" + addr + "/ws";
    this.httpAddr = "https://" + addr;

    this.deviceMap = {};


    this.onmessage = function(){
        console.log("data received");
        console.log(event.data);
    }

    this.available = function(){
        // return true if the helper is running
        //
        var text = $.ajax({
            timeout:5,
            url: this.httpAddr,
            async: false,
        }).responseText;
        if(text == "OK"){
            return true;
        }

        return false;
    }

    this.request = function(cmd, data, success){
        var cmdUrl = this.httpAddr + cmd;
        $.ajax({
            url: cmdUrl,
            data: data,
            success:success,
            method:'POST',
            dataType: 'JSON',
        });
    }

    this.serial_list = function(callback){
        this.request("/device-list", {}, function(data){
            console.log(data);
            //extension
            var devices = data.map(function(e){return e.Name;});
            console.log(devices);
            callback(devices);
        });
    };

    this.serial_open = function(id, opts, callback){
        // id idCOM1
        // opts 

        //ajax
        var opts = Object.assign(opts, {deviceId: id});
        console.log("now ajax to open device " + id, opts);
        var openResult = $.ajax({
            url: this.httpAddr + "/open-device",
            data: opts,
            method: "POST",
            async: false,
        }).responseText;

        if(openResult == "OK"){
            //
            var dev = new WSDevice(id, this.wsAddr);
            callback(dev);
        }else{
            callback();
        }

        return; //

        if(this.deviceMap[id]){
            callback(this.deviceMap[id]);
        }else{
            //ajax
            //
            var dev = new WSDevice(id, this.wsAddr);
            this.deviceMap[id] = dev;
            callback(dev);
        }

    }
};

